    title:{
        color:"blue",
        fontFamily:"Asap",
        fontSize:"60px"
    }
}));

const Writing = () => {
    const classes = useStyles();
    return(
        <React.Fragment>
            <div className={classes.title}>
                Writing
            </div>
            <div>
            <ReCAPTCHA
                required
                // sitekey={recaptchaKey}
                size="large"
                badge="inline"
                hl="zh-TW"
                // onChange={this.reCaptchaOnChange}
                style={{width:"100%"}}
            />
            </div>
        </React.Fragment>
    )
}

export default Writing;
